INSERT INTO `chicken_soup` VALUES (1, 0, '如果你吃了亏，千万不要喝水，不然你会变污的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (2, 0, '如果时间可以倒流，那一定是，你在做梦。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (3, 0, '听说你的城市下雨了，不知道你带伞没有，如果带了这雨就白下了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (4, 0, '为什么有些人要把追求精神满足和追求物质上的富足对立起来呢?你不幸福是因为你境界不高，你物质生活差是因为你能力不行。这完全是两回事儿。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (5, 0, '猪猪那么可爱，你们能不能炖香一点。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (6, 0, '梦想还是要有的，万一别人问呢', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (7, 0, '今天解决不了的事情，不必着急，因为明天还是解决不了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (8, 0, '你我都渴望成功，哪怕要付出很多。但我们连早点儿起床都做不到。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (9, 0, '人心不足蛇吞象，没有实力别硬上！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (10, 0, '当你觉得自己又丑又穷，一无是处时，不要灰心也不要绝望，因为至少你的判断是对的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (11, 0, '摊煎饼的大妈说，她月入三万，不差你一个鸡蛋。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (12, 0, '顺其自然只是无能为力的另一种说法。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (13, 0, '很同情那些名校毕业生。这些人中的绝大多数，一生最大的成就就是高考的成功，一下超越了社会中的各种阶层，仿佛升到顶端。之后一辈子都在走下坡路。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (14, 0, '你不能总看那些你没有的，多看看你拥有的。算了你把眼睛闭上吧。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (15, 0, '认真你就输了。咋啦，不认真的你赢过几次？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (16, 0, '长大以后我终于不是那个傻孩子了，而是成了傻子！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (17, 0, '老板说只要我们努力工作，明年他就可以换玛莎拉蒂了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (18, 0, '假如生活欺骗了你，不要悲伤，不要心急，多被骗几次就好了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (19, 0, '女孩子自信一点才漂亮，但是漂亮的女孩子谁不自信啊！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (20, 0, '扎心？不存在的！心都没有扎哪里？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (21, 0, '当利足够大的时候，又有几个人不会出卖自己的一切?别说自己不会，只是利益不够大而已。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (22, 0, '绿茶婊从来都是女人讨厌，男人沦陷。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (23, 0, '喜欢就去表白，不然你不会知道自己长得多丑。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (24, 0, '只有长得好看的人吃的多才叫吃货，你那就叫饭桶。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (25, 0, '善良没用，你得漂亮，还得有钱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (26, 0, '该失望的事从没辜负过我，每次都认认真真的让我失望。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (27, 0, '不为五斗米折腰的陶渊明是饿死的……', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (28, 0, '岁月是把杀猪刀，可是他拿丑的人一点办法都没有', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (29, 0, '再买就剁手！能剁左手么，我习惯用右手掏钱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (30, 0, '比你聪明的人比你努力，那你努力还有什么用？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (31, 0, '这么多年了， 性生活是你唯一能自理的生活。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (32, 0, '世界上唯一一件公平的事就是我们都会死。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (33, 0, '我觉得这种“古巨基长这样还需要隐瞒爱情20年”这几种论题都应该入选“世界未解之谜”。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (34, 0, '只要是能用钱解决的问题，你一件都解决不了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (35, 0, '你以为你是独行的猛兽，其实只是离群的牛羊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (36, 0, '你要相信明天，一定会更好的，更好的把你虐成狗。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (37, 0, '小时候不努力念书，长大只能给人点赞。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (38, 0, '相亲很多时候互相看不上，可是明明你们条件很配啊！介绍人不傻，要是你家没镜子，去相亲你会了解到别人眼中的你的档次。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (39, 0, '我们非常努力，才能活得像个普通人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (40, 0, '学术能力的缺乏并不意味着你就擅长混社会，说不定还不如在学校的表现。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (41, 0, '我也有诗和远方，只不过诗很烂，远方一片黑暗。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (42, 0, '上帝为你关上了一扇门，然后就去洗洗睡了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (43, 0, '你的感情路不顺吗?很顺啊，一路上连个人影都没有。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (44, 0, '蹲下来摸摸自己的影子，对不起，跟着我让你受委屈了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (45, 0, '撩你不是因为喜欢你，而是因为看你的样子就知道你很容易睡。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (46, 0, '腦子有病得治，像你多好，沒有腦子。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (47, 0, '睡觉睡到手抽筋，数钱数到自然醒。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (48, 0, '优秀幸福的人是喜欢撒娇的，告诉别人自己这儿过得不好，那儿过得也不好。有些人当真的了，觉得别人天天是在宝马车中哭泣。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (49, 0, '你觉得我不好相处可能是因为我讨厌你吧。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (50, 0, '失败是成功他妈，失败一次次的怀孕最后都流产了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (51, 0, '后宫里发生的破事90%都是因为没有监控。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (52, 0, '不使劲挖掘，还不知道自己的潜能只有一点点。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (53, 0, '有人问我如何在这个物质恒流的社会独善其身，我回答了一个字“穷”。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (54, 0, '假如生活欺骗了你，不要悲伤，不要绝望，因为明天，后天，大后天，生活还会继续欺骗你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (55, 0, '你当他/她是恋爱对象，他/她当你是练爱对象。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (56, 0, '減肥是一件大事，先讓我吃飽了，再來好好計畫計畫。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (57, 0, '不要担心黑夜悠长，保持平静安宁可以睡的更久。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (58, 0, '如果所有人都理解你，那你得普通成什么样。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (59, 0, '上帝为你关上一道防盗门，还会顺手给你上了一把钛合金锁。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (60, 0, '不要太在乎别人的目光，因为没人会注意你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (61, 0, '无论最后我们疏远成什么样，一个红包，就能回到当初。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (62, 0, '镜子破了，你TM圆一个给我看看。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (63, 0, '人家说你看着小，其实并不是你娃娃脸，而是你穿得土。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (64, 0, '千里之行始于足下，没钱没票还是算了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (65, 0, '那么努力还不是因为你平庸。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (66, 0, '努力了这么久，但凡有点儿天赋，也该有些成功的迹象了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (67, 0, '比挂科补考更让你头疼的，是蚂蚁花呗和京东白条的还款提醒', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (68, 0, '努力加油，每一个困难，都会克服我。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (69, 0, '哪有什么感同身受的心，全是站着说话不腰疼的嘴。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (70, 0, '小伙子们现在好好奋斗，将来给你心爱的女生多添点份子钱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (71, 0, '怕鬼真的太幼稚了，我带你看看人心。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (72, 0, '你配不上你的野心，也辜负了你所受的苦难。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (73, 0, '加我回来吧，我给你发我的婚礼请柬。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (74, 0, '拿钱解决问题算什么本事，有种你们看我TM连钱都拿不出来', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (75, 0, '好好活下去，每天都有新打击。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (76, 0, '转角一般不会遇到爱，只会遇到乞丐。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (77, 0, '你努力做到最好，还不如别人随便搞搞。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (78, 0, '善良没用，你得漂亮。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (79, 0, '看了何以笙箫默，你以为赵默笙是傻白甜，可你别忘了人家和何以琛考得是同一所大学。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (80, 0, '總以為退一步海闊天空，沒想到腳下落空。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (81, 0, '九年义务教育应该开腹语课，毕竟长大后会有太多话，难以启齿。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (82, 0, '精神追求应当是物质追求得到满足后的自然反应。而不是在现实受挫后去寻求的安慰剂。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (83, 0, '人生真是有得就有失。我的一个朋友找了一位非常有钱的老公。虽然得到了享不尽的荣华富贵，但却失去了烦恼。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (84, 0, '面对困难我们一般从不弯腰低头，一般都是直接跪。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (85, 0, '上帝为你关上一扇门的时候还会顺手帮你把窗户也关上。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (86, 0, '你总想等你优秀了再去向她表白，后来才发现你都这么优秀了干嘛还喜欢她。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (87, 0, '你无法叫醒一个不回你消息的人，但是红包能。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (88, 0, '你有诗和远方也没用，生活对你虽远必诛。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (89, 0, '知识给你力量，无知会给你更强大无畏，且无法预测的力量。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (90, 0, '一句话说明你拖延症有多严重。“君子报仇，十年不晚。”', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (91, 0, '其实只要不要脸，很多人生难题都能迎刃而解。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (92, 0, '又一天过去了。今天过得怎么样，梦想是不是更远了?', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (93, 0, '人只要学会破罐破摔，一切都豁然开朗。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (94, 0, '真正努力过的人，就会明白，天赋是有多么重要。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (95, 0, '年轻人嘛，现在没钱算什么，以后没钱的日子还长着呢。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (96, 0, '喜欢一个人一定要去告白，不被拒绝一下，你还真以为自己是小仙女了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (97, 0, '自从知道狂犬疫苗造假，心里没底气，见了狗客气多了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (98, 0, '抱最大的希望，为最大的努力，做最坏的打算。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (99, 0, '最怕你一生碌碌无为，还安慰自己平凡可贵。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (100, 0, '现在的女生太不像话了，领口开这么低，还看不到事业线。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (101, 0, '以毒攻毒：放心喝你的“敌敌畏”吧，稍后我会喂你一瓶“百草枯”，你死不了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (102, 0, '找对象的时候，不要光看对方外表，得先看看自己外表！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (103, 0, '鸡汤就像是你的梦境，毒鸡汤就像是你的现状。睡着以后也不能保证每次都做梦，但是现实却环绕在你触手可及的地方。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (104, 0, '如果你早上刷牙恶心干呕，那就不要对着镜子刷。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (105, 0, '年轻时总是缺乏对自己的正确认识。时而觉得自己能力超群，海阔天空，时而觉得一无是处，平凡无能。长大后，经历得多了，逐渐认清自己，才发现自己原来是一无是处，平凡无能。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (106, 0, '不要没完没了的修图。你现实中长得丑，我们都知道。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (107, 0, '虽然你胸小，但是你脸大啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (108, 0, '虽然我学得慢，但是我放弃的快啊！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (109, 0, '如果你花钱都不开心，那么是你花钱方式不对。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (110, 0, '减肥，你想要坚持，但坚持不想要你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (111, 0, '养儿不防老，擦防晒霜才防老。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (112, 0, '那些说“钱买不来快乐”的人，是不是从来没穷过啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (113, 0, '每天只想快点回家躲到被窝里 毕竟在外面跟演戏似的', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (114, 0, '好看的皮囊千篇一律，有趣的灵魂两百多斤。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (115, 0, '38岁以前我穷，但是以后，我会习惯的！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (116, 0, '如果不能随时有效的反击，所有的宽容都是因为懦弱。承认吧，你所有的宽容只是因为你懦弱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (117, 0, '如果十年之后你未娶，我未嫁，那真是太惨了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (118, 0, '成长就是将你哭声调成静音的过程。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (119, 0, '生活不止眼前的苟且，还有远方等着你耕的田野。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (120, 0, '爱情说白了就是在对的时间碰到有感觉的人，没有那么复杂。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (121, 0, '别低头，王冠会掉。摔坏了你可赔不起。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (122, 0, '虽然我干的多还辛苦，但是我挣得少啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (123, 0, '失败并不可怕，可怕的是你还相信这句话。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (124, 0, '同样是出卖自己，有的人成了大姐，有的人成了小姐。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (125, 0, '哀莫大于贼心不死。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (126, 0, '小明长期被爸妈蒙在鼓里，导致窒息而死。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (127, 0, '喜欢就要说出来，万一成备胎了呢。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (128, 0, '你的颓废是我前进的理由。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (129, 0, '给你的梦想插上翅膀，你也飞不到哪里去。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (130, 0, '经过十年不断的努力和奋斗，我终于从一个懵懂无知的少年变成了一个懵懂无知的青年。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (131, 0, '你听过的情话不都是为上床做铺垫吗？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (132, 0, '说到不一定能做到，所以谨言慎行。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (133, 0, '真的猛士，敢于直面肥胖的人生，敢于正视缺位的智商。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (134, 0, '我这张脸只要遮住两个地方就完美了！一处是右半边脸，另一处是左半边脸。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (135, 0, '今天的事不用放在今天做，万一明天死了呢，就可以不用做了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (136, 0, '很多人发现自己在钱权女人的问题上比不过别人，于是开始试着在道德和人生境界上做文章。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (137, 0, '每当我勇敢地走出一步，上帝就会及时慷慨地为我，铺好下一步下坡路。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (138, 0, '人生不如意之事十有八九，剩下的十之一二，超级不如意。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (139, 0, '好运一定会降临，只是会降临在别人头上。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (140, 0, '“长的好看的女人都不靠谱。” “那不好看的呢？” “既不好看，又不靠谱。”', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (141, 0, '是虚荣、骄傲、嫉妒与报复，支撑你到今天。你的成长是依赖这些负的能量，而非天生的善良。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (142, 0, '弱者都是这样，觉得生活中的无奈太多，自己又无力改变。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (143, 0, '真正努力过的人才知道，智商上的差距是不可逾越的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (144, 0, '黑夜从来不会亏待晚睡的人，它会赐予你黑眼圈，和即将猝死的身体。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (145, 0, '熬夜对身体不好，建议通宵。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (146, 0, '别人都有背景，而你只有背影。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (147, 0, '死马当活马医：反正医药费你得照付。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (148, 0, '不孝有三，无后为大。剩下两个是不相亲和不考公务员。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (149, 0, '有时候我们觉得是别人误会了自己，其实是我们误会了自己。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (150, 0, '不要总是那么自恋，美女多看了你一眼，只是因为你丑得比较独特。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (151, 0, '别对我大吼大叫 我小时候被狗吓过。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (152, 0, '凡人皆有一死，这是上帝给我们的唯一公平。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (153, 0, '其实不管选择哪条路、怎么过，你以后都会后悔，不信你回头看看你之前的人生。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (154, 0, '别觉得身边的人都在针对你，仔细想想其实，整个世界的人都在针对你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (155, 0, '哪怕失败了九十九次，我也要努力凑个整。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (156, 0, '努力到无能为力，拼搏到感动自己，最后发现还是没能成功。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (157, 0, '我泼出去的水，盆都可以不要。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (158, 0, '绝对不会输的唯一方法，那就是不要战斗。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (159, 0, '酷的像风 野的像狗 不招人喜欢倒也自由。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (160, 0, '跟丑这个缺点比，穷根本不值得一提。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (161, 0, '愿你所有的丧，都是临时医嘱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (162, 0, '心是伟大的诗人，而嘴是蹩脚的编辑。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (163, 0, '俗话说人无远虑，必定很有钱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (164, 0, '爱情就是，如果没有更好的选择了，我才陪你到天荒地老。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (165, 0, '死并不可怕，怕的是再也不能活了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (166, 0, '早起的虫子被鸟吃。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (167, 0, '岁月不饶人，首先不饶女人;机会不等人，首先不等男人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (168, 0, '对于今天解决不了的问题不要着急，因为明天你也解决不了啊！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (169, 0, '世上无难事只怕有钱人，物以类聚人以穷分。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (170, 0, '有一种病叫看过听过励志演讲励志电影励志书籍励志歌曲知乎励志答案仿佛就已经奋斗努力过了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (171, 0, '你要站在别人角度上去思考，总有一天你会发现，你丢失了自己。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (172, 0, '所有抱怨社会不公和制度的人翻译过来只有一句话：请给我金钱，女人和社会地位!', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (173, 0, '撞衫不可怕，谁丑谁尴尬。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (174, 0, '自由从来不是什么理所当然的东西，而是一项需要极高成本的特权。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (175, 0, '是什么引起公主病的？又丑又穷脾气又不好。那有钱又漂亮脾气又不好的呢？人家那就是公主。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (176, 0, '条条大路通罗马，而有的人就生在罗马。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (177, 0, '有些人努力了一辈子，也就从社会的四流进入了三流。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (178, 0, '以前我以为钱可以买到一切，现在觉得真的不行，因为我钱不够。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (179, 0, '有些人不是赢在了起跑线上，而是直接生在了终点。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (180, 0, '太久没动笔，现在一动笔这样作业就有一种皇帝批阅奏章的感觉。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (181, 0, '做好万全的准备，就是为了当机会来临时，你可以巧妙的避开它。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (182, 0, '多照照镜子，很多事情你就明白原因了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (183, 0, '人生前期千万不要因为没钱而觉得悲哀 因为你以后没钱的日子还有很长。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (184, 0, '如果你面前有一大笔钱，和一个万人迷，那么这和你有什么关系呢？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (185, 0, '你觉得很孤独，没关系，你还有手机。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (186, 0, '今天很残酷，明天很残酷，后天会很美好，那就再睡两天。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (187, 0, '老板和领导很清楚哪些人能够得到晋升。对于那些不能的人，他们也会不断地鼓励和给她们希望。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (188, 0, '丑小鸭变成白天鹅，并不是它有多努力，而是它生来就是白天鹅。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (189, 0, '只要你每天坚持学习，最终胜利肯定是属于，在考场上发挥好的人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (190, 0, '有梦就要去追，待会儿醒了，就不容易再睡着了', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (191, 0, '没有解决不了的问题，但是有解决不完的问题。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (192, 0, '人作的程度不能超过自己的颜值。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (193, 0, '幸福离我们并不遥远，它一直在我们那些长相姣好，家境优越，脑瓜好使，积极乐观的朋友身上。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (194, 0, '出身不好的限制也不光是平台问题。出身不好，说明你父母混的也不怎么样，也许你基因里就写着“不行”两个字。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (195, 0, '减什么肥啊，脸丑和体胖又没有什么关系。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (196, 0, '人生很多事，终究是会随着时间好起来的。像很多人原本只是胖，久了就变好胖。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (197, 0, '他给你的爱会消逝，他给你的金钱却不会贬值。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (198, 0, '不要看轻你自己，马云王健林还有你，你们三人的资产加起来足以震撼整个中国乃至世界的经济体系。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (199, 0, '上帝为什么给你关上一扇门，还不是因为你见不得人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (200, 0, '有人“发”“花”不分。经常说成：是金子总会花光的。不过好像也没错。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (201, 0, '你人人称道的美丽，里面都有PS的痕迹。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (202, 0, '你忙了一天，说：累成狗了。 你以为你不累就不是狗了！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (203, 0, '对不起，我没有回你信息。这只是因为我一点也不关心你的感受 。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (204, 0, '假如生活出卖了我，你说他是论斤称的还是论个卖的？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (205, 0, '体重不过百，不是平胸就是矮，说的好像过百就是大好身材一样。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (206, 0, '幸亏当事者迷，不然真的看清事实真相，很多人是承受不来的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (207, 0, '生活不仅有诗和远方，还有交通拥挤和住房紧张。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (208, 0, '能不能对我真心一点？当然可以！我是真心不喜欢你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (209, 0, '有些人努力了一辈子，就是从社会的四流挤入了三流。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (210, 0, '厉害的不是你有多少后台，而是你能成为多少人的后台！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (211, 0, '你每天都那么努力，忍受了那么多的寂寞和痛苦。可我也没见你有多优秀。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (212, 0, '别以为世界没了你，没什么区别，没了你地球转得更快。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (213, 0, '昨天遇到小学同班同学，没想到他混的这么差，只往我碗里放了一块钱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (214, 0, '我发现没有任何一个煤矿工人靠挖煤多又快当上了煤老板。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (215, 0, '如果一个人秒回了你，也只能说明这个人在玩手机而已。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (216, 0, '口中的道德和原则虽然重要，却总是要给手里的利益让道。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (217, 0, '看到一个人很像你，我追了上去，突然想起这个城市没有你，我放下了手中的砖头，差点打错人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (218, 0, '大多数时候，挣扎只会让你死的更快一些。努力的结果不过是从实践上证明了你压根就不行。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (219, 0, '悄悄地我吃了，正如我悄悄地胖。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (220, 0, '回首往事，是不是发现自己失去了很多，遗憾吧！放心，你以后会失去得更多。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (221, 0, '别让一张考卷决定你的前途，毕竟一次高考有那么多张。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (222, 0, '假如生活欺骗了你，不要灰心，因为明天也一样。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (223, 0, '直觉告诉你，她不喜欢你，那么你的直觉很正确。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (224, 0, '当一件事情需要通过辩论或者争吵来让对方屈服时，这不代表对方的不可理喻，而是自己的无能。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (225, 0, '先生，你这张卡上的钱也不够……', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (226, 0, '以前的女孩 会像她们母亲那样洗衣做饭.现在的女孩 会像她们父亲那样抽烟喝酒。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (227, 0, '“下次考试我一定认真复习” - 学渣最大的谎言。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (228, 0, '说好了浪荡一生，却不小心一生钟情一个人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (229, 0, '女人以为男人傻，男人喜欢的是颜值好么？有颜值又婊的出，是多么优秀的能力啊？！别想了，没颜值婊不起来的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (230, 0, '一懒众衫小，薪尽自然凉。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (231, 0, '为什么单身，因为你不仅仅丑，而且还嫌别人丑。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (232, 0, '根本没有什么高冷的人，人家暖的不是你而已！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (233, 0, '人的一生有一个世纪那么长，可半个世纪都用来睡觉了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (234, 0, '不明白你们遇到好事，为什么要掐腿揉眼睛，真醒了怎么办？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (235, 0, '你只需看着别人精彩，老天对你另有安排。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (236, 0, '看本小说，故事竟然不是发生在香榭丽舍大街，而是在长沙黄兴路步行街！！！如此怎能归类到“爱情小说”?', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (237, 0, '我从来不会脑残地在网上晒自己买的名牌，因为我买不起。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (238, 0, '追不到那个人，说到底还是你没本事。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (239, 0, '以大多数人努力的程度，远远达不到拼天赋的程度。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (240, 0, '只要是用钱能解决的事情，我一件都解决不了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (241, 0, '虽然努力不一定会成功，但是不努力可以很舒服。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (242, 0, '你用尽全力取得的成就，只是某些人的起点而已。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (243, 0, '以前觉得靠关系的人一定是很无能，接触过后发现人家样样比你强。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (244, 0, '每次想省钱的时候，就是你智商到达顶峰之时！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (245, 0, '希望能成为一个有趣和有钱的人，实在不行，光有钱就行', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (246, 0, '告诉我你在哪个街角，我，肯定不去。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (247, 0, '出门见钱不捡就算丢。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (248, 0, '你努力后的成功，不能弥补你成功前的痛苦。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (249, 0, '人还是要谈一次恋爱，不然就不知道，对象能有多烦人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (250, 0, '你就像仙女一样，但我讨厌仙女。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (251, 0, '从年初的一无所有，到年终的身无分文，不一样的烟火，我就是我，看着就窝火，一年白忙了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (252, 0, '像我这种连名牌都不认识几个的人，有时候连别人在炫富都感觉不到。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (253, 0, '只要坚持下去，总会有失败的一天。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (254, 0, '为什么造假酒？据我分析，他肯定造不出真的来。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (255, 0, '钱虽然不是万能的，确是9999元能的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (256, 0, '秒回并不是喜欢你，只是碰巧在玩手机。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (257, 0, '你要吃饱、要早睡、不要仗着自己长得丑就可以任意熬夜。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (258, 0, '输入法忘不了的东西，清除数据就好了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (259, 0, '你并非什么事情都不做准备，起码你已经，准备好了要失败的嘛。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (260, 0, '你必须非常努力，才能相信自己是真的无能为力。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (261, 0, '经过十年的不断奋斗和磨砺，我终于从一个懵懂无知、敏感脆弱的少年，成长为了一个懵懂无知、敏感脆弱的青年。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (262, 0, '社会学家研究表明：难看和没钱的男人，并不比高帅富更加靠谱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (263, 0, '“那些出身好能力强的人努力是为了成功，因为人家有可能会成功。我们努力是为了啥呢？”“为了活下去。”', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (264, 0, '书山有路开车去，学海无涯就算了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (265, 0, '只要我吃的夠快，体重绝对追不上我！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (266, 0, '“感觉你跟你婆婆的关系很好呢！” “那是当然！我婆婆把我当亲闺女般..........揍！”', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (267, 0, '人就要趁年轻的时候多出去走走，看看不同的风景，不同的文化，等转遍了世界你就会发现，原来躺在被窝里是真他妈舒服。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (268, 0, '我不需要性生活，生活每天都在强奸我。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (269, 0, '人们大概都听过：不忘初心 方得始终。然而却没几个人知道下一句是：初心易得，始终难守。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (270, 0, '今天解决不了的事就留到明天，或许明天运气好死了就不用解决了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (271, 0, '就算你充电五分钟，那也没有人愿意和你通话两小时啊～', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (272, 0, '朋友事业上获得突破，生活提升了档次，我真替他高兴。不过要是能换成我，我会更高兴。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (273, 0, '永远不要轻易的向别人展示伤口，因为你不知道他手里握的是云南白药还是孜然辣椒面。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (274, 0, '长得丑就是病，不然整形医院为什么叫医院。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (275, 0, '为什么要吵架呢，就不能心平气和的坐下来砍对方几刀吗。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (276, 0, '三十岁之前，过的很苦逼，要啥没啥，三十岁之后，之后，你就习惯了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (277, 0, '用钱当然买不到快乐，只是有钱，别人会想办法让你快乐。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (278, 0, '生活中很多人喜欢小题大作，其实真的没有必要，要想想大题怎么办。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (279, 0, '偶尔还是要出去走一走，才知道躺床上多么舒服。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (280, 0, '外貌不重要，爱情看的是感觉，但是我对丑的没感觉。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (281, 0, '马不停的是蹄，你不停的是嘴。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (282, 0, '如果你想要成功，你必须拼命实现身边所有人对你的期待，并且直到死都一直在保持这种做法。但是，你要是想失败，你只要活成上面的反面就可以了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (283, 0, '只要你肯吃苦，肯努力，肯放下身段，去要饭，总会有人赶的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (284, 0, '谁说我不会乐器？我退堂鼓打的可好了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (285, 0, '上帝为你关上一道门的同时，还会顺带夹你的脑子。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (286, 0, 'TA爱你不会在乎你有没有钱，如果你没有TA会再找一个。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (287, 0, '造成婚外恋的根本原因，是结婚。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (288, 0, '一些年轻人，通过高端消费来营造自己高端收入的形象。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (289, 0, '别太自信，你可能信错了人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (290, 0, '有时候，只要你下定决心做某件事，全世界都会拖你后腿。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (291, 0, '在最美的年纪遇见你，我想说，真是倒了血霉了！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (292, 0, '比你优秀的人都在努力，你还努力有什么用。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (293, 0, '爱就像是食品店里的苹果，你根本找不出不带瑕疵的。每个人都不完美，尤其是你自己。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (294, 0, '人不会死在绝境，却往往栽在十字路口。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (295, 0, '哪有什么孤独，不就是没人爱吗？哪有什么寂寞，不就是闲的吗？哪有什么绝望，不就是穷的吗？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (296, 0, '从前车马很慢，书信很远，一生只够爱一个人，但是可以纳很多妾啊！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (297, 0, '穷一点不要紧，要紧的不止一点。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (298, 0, '毕业之后我换了五六个手机号，可同学结婚还是联系到了我', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (299, 0, '每天显得无聊或寂寞了，去找朋友一起吃饭和逛，只不过是为了满足自己与人交往的需求，算不上是社交。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (300, 0, '如果你同时爱上了两个人，请选择第二个。因为如果你真的爱第一个，就不会爱上第二个。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (301, 0, '当你摔倒但周围没人笑的时候，你就知道你已经是个老年人了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (302, 0, '小时候觉得方便面特好吃，想着长大以后一定要顿顿方便面，现在真的顿顿方便面。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (303, 0, '这段日子迷惘又黑暗，撑过去了会有下一个黑暗等着你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (304, 0, '失败是成功之母，但是成功六情不认。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (305, 0, '所有抱怨社会不公和制度的人，翻译过来只有一句话：请给我金钱，女人和社会地位', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (306, 0, '你曾天真的以为金钱是万能，后来才发现，金钱不是万能的，是无所不能的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (307, 0, '书山有路勤为径，怪你没有富贵命。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (308, 0, '喜欢就要说出来，不然你怎么能和女神做朋友呢。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (309, 0, '你总是这么努力，每天忍受许多寂寞与折磨 ，受尽委屈，但我们也没觉得你多优秀。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (310, 0, '房价就是天然避孕药。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (311, 0, '谁能想到，这名16岁的少女四年前只是一名年仅12岁的少女。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (312, 0, '不爱你的人，比你想象中的还不爱你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (313, 0, '如果有人问我：那些艰难的岁月你是怎么熬过来的？ 我想我只有一句话回答：我有一种强大的精神力量支撑着我，这种力量名字叫“想死又不敢”。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (314, 0, '很多人发现自己在钱、权、女人的问题上比不过别人，于是开始试着在道德和人生境界上做文章。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (315, 0, '那些把爱情说得很透彻的人，基本上都不在爱里。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (316, 0, '加油，你是最胖的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (317, 0, '他说你任何为人称道的美丽，不及他第一次遇见你的闺密。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (318, 0, '朋友，那不是懒，懒是可以克服的。你只是脑子比较弱(笨)，没办法长时间经受高强度的思考，去搞逻辑太复杂的东西和处理太多的信息量。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (319, 0, '半夜给你留灯的，只有自动售货机。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (320, 0, '别看别人表面上事事如意，其实他们背地里，也顺风顺水。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (321, 0, '我的身体是铁打的，可是我的床是磁铁打的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (322, 0, '我从你眼里看到了两样东西，一样是真诚，而另一样是眼屎。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (323, 0, '有些人表面上考试分数很高，却不知道他们在背地里也没少玩儿', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (324, 0, '坚持就是失败。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (325, 0, '你十分努力的突破了瓶颈，最后你会发现还有瓶盖。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (326, 0, '别说王子有多爱灰灰姑娘，TM的就隔了一个晚上就忘了啥样要靠水晶鞋。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (327, 0, '下雨了才发现自己并不孤单，大家都一起避雨，可人家等的是伞，你等的是雨停。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (328, 0, '别看我平时对你漠不关心，其实私下里我每天都盼着你出事', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (329, 0, '再也沒有任何事情，比晚睡更快樂了，除了晚起。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (330, 0, '好女孩只得到了好字，而漂亮女孩却得到了所有。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (331, 0, '谢谢你，在我每次需要你的时候都掉链子。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (332, 0, '你总嫌有些人懒，说得好像你勤快了就真能干出什么大事儿一样。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (333, 0, '单身是个很好的借口，说得好像妹子们会看上你似的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (334, 0, '注重细节，从小事做起，因为你根本做不了大事。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (335, 0, '男追女隔座山，翻过山就好了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (336, 0, '有缘千里来相会，无缘倒也省话费。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (337, 0, '困难也许会迟到，但绝不缺席。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (338, 0, '一直很佩服拉面馆切牛肉师傅的刀功，都是纳米级别的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (339, 0, '梦想还是要有的，万一哪一天就被别人实现了呢。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (340, 0, '“不去努力然后告诉自己我根本就不想要”的痛苦，比“拼命努力后失败”的痛苦，要小得多。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (341, 0, '有趁着年轻多出来走走看看，不然你都不会知道呆在家里有多爽。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (342, 0, '学海无涯，回头是岸。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (343, 0, '开始我以为生活就是猫吃鱼，狗吃肉，奥特曼打小怪兽，可现实却是鼠整猫，羊耍狼，两熊玩死光头强。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (344, 0, '爱真的需要勇气，来接受，一次次的没人爱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (345, 0, '如果上帝没有给你想要的，不是因为你值得拥有更好，而且你不配。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (346, 0, '没吃饱只有一种烦恼，吃饱了有无数的烦恼。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (347, 0, '打算卖房去旅行，结果房东不同意', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (348, 0, '世界那么大，我想去看看；人生那么短，走也走不远。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (349, 0, '爱笑的女生运气不会太差。说实话，如果一个女生运气一直不好，我不知道她怎么笑得出来。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (350, 0, '每当你打算开始存钱，心里总有个声音在说：“对自己好点”。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (351, 0, '成败是评判英雄的唯一标准。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (352, 0, '我发现很多混得不好的人看得都很开。也不知道他们是因为看得透彻而不屑于世俗的成功，还是因为不成功而不得不看得开。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (353, 0, '你爱不爱你的工作，工作都会在那等你，不离不弃。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (354, 0, '很多人所谓的追逐梦想，就是不想要辛苦努力地付出，还可以轻松自由地生活。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (355, 0, '你老是这么抠门，门都被你，抠坏了好几扇。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (356, 0, '你就两点不行，这也不行，那也不行。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (357, 0, '一个姑娘的介绍：思想上的女流氓，生活中的好姑娘。 然而给我的感觉是：心思活络的丑逼。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (358, 0, '卑微的少年，不要害怕，我们终将光芒万丈，比如说火化的时候。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (359, 0, '生活和电影不一样，生活难多了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (360, 0, '有些女生觉得说自己是吃货能显得可爱，其实并没有这样的效果。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (361, 0, '月薪一万以下的人是没有资格取英文名的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (362, 0, '无论你二或不二，二就在那里，不三不四。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (363, 0, '有多努力，最后就会有多少无力感，太多了，都要溢出来了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (364, 0, '世上无难事，只要肯放弃。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (365, 0, '世界上本没有路，走的人多了，老师就开始点名了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (366, 0, '别再抱怨你此生找不到一个对的人，当初的数学选择题就四个，你也找不到对的答案啊！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (367, 0, '赠人玫瑰，手有余香，所以被老婆发现了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (368, 0, '请问在三伏天，有什么消暑良方吗？薪尽自然凉。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (369, 0, '对于穷人，生活不累的话，那就不叫生活！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (370, 0, '一想到你，我的丑脸，就泛起微笑。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (371, 0, '就算你努力了，没有成功还是被别人看不起。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (372, 0, '生活磨光你的棱角，是为了让你，滚的更远。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (373, 0, '别人露腿那叫美，你露腿就想让人怼。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (374, 0, '一想到为人父母竟然不用经过考试，就觉得太可怕了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (375, 0, '你以为他给你点赞，是喜欢你？只是手滑罢了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (376, 0, '千万不要以为高中单身时因为学校禁止早恋。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (377, 0, '做好人没希望，做坏人不擅长。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (378, 0, '只有真正努力过的人才会知道，天赋有多重要。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (379, 0, '财富充足的情况下，很多问题都不是问题。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (380, 0, '年轻的时候多吃些苦，这样老了吃苦才习惯。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (381, 0, '哪怕抛掉出身的因素，我觉得你也未必干得过别人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (382, 0, '俗话说张家长，李家短，这是真的么？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (383, 0, '你给小草一点爱，小草还你一片绿！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (384, 0, '别人说你有潜力的时候先别高兴太早。因为...“实力不够，潜力来凑”。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (385, 0, '不要怕别人比你优秀，只要肯努力，别人会比你更优秀。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (386, 0, '长得丑怎么了？我自己又看不到，恶心的是你们！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (387, 0, '望穿秋水之寒，无论如何也比不了，忘穿秋裤之冷。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (388, 0, '学而不思则罔，思而不学则网贷。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (389, 0, '比一个人吃火锅更寂寞的是，一个人没有钱吃火锅。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (390, 0, '不笑运气差，一笑脸就大！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (391, 0, '我超级超级喜欢小动物，怎么说呢，就是顿顿都有吧', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (392, 0, '如果你特别迷恋一个人，那你肯定配不上ta。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (393, 0, '人生就是这样，有欢笑也有泪水。一部分人主要负责欢笑，另一部分人主要负责泪水。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (394, 0, '你以为努力有用？其实努力了也一样没用。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (395, 0, '早起的鸟儿有虫吃，早起的虫儿被鸟吃。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (396, 0, '喜欢一个人就勇敢表白，也许你还能知道自己是几号备胎。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (397, 0, '我有位家境一般的朋友，一直觉得如果自己有钱一定会更幸福。后来他妈做婴幼教育发财了。快十年后我见他，问：现在你倒是有钱了，你真的幸福吗?他回答：爽翻啦!我默默地走开了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (398, 0, '总有一天，你会遇到一个好姑娘，她不要你的房，也不要你的车，不要钻石，更不要你的钱，当然她也不要你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (399, 0, '加油，你是最差的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (400, 0, '每个人都自诩经验大师，动不动就对你进行说教，你要做的是：能不听就不听。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (401, 0, '男女之间一定有纯真的友谊，因为每一个认识我的女生，都说最多只能跟我做朋友。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (402, 0, '那些年立下的FLAG自己删了吧，反正也没人记得。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (403, 0, '普通人一生的四个阶段：心比天高的无知快乐与希望——愧不如人后的奋斗与煎熬——毫无回报的愤懑与失望——坦然的平凡和颓废。你走到哪一步了?', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (404, 0, '世界这么大，我想去看看，什么地方要饭比较方便。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (405, 0, '只要我肯努力，没什么事情是我搞不砸的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (406, 0, '男人的“五分钟到家”和女人的“五分钟就能出门”其实是一个意思。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (407, 0, '大部分成功靠得既不是厚积薄发的努力，也不是戏剧化的机遇，而是早就定好的出身和天赋。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (408, 0, '努力不一定有收获，但不努力缺可以很舒服哦。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (409, 0, '伍迪艾伦:\"把每一天当成最后一天活，总有一天你会活对的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (410, 0, '别人存你的号是为了跟你联系，我就不一样，我存你的号就是为了不接。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (411, 0, '只要是石头，到哪里都不会发光的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (412, 0, '吃的苦中苦，才知白辛苦。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (413, 0, '基因是你给的，成长环境是你给的，社会阶层是你给的——还有脸埋怨自己孩子没出息。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (414, 0, '每天都要有新的期待，这样才能有新的失望。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (415, 0, '被打趴下就不要爬起来了，反正还是会被打到趴下。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (416, 0, '多照照镜子，很多挫折磨难你就明白个中原因了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (417, 0, '直到三十岁才知道，和不同的人说不同的话，表现出不一样的态度，是一种非常可贵的能力，而不是虚伪。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (418, 0, '别以为王子有多爱灰姑娘，才一晚上就TM忘了是谁了，全靠水晶鞋。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (419, 0, '愿你的仇人出走一生，归来仍是站票。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (420, 0, '这个世界上只要努力，没有什么事情是你搞不砸的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (421, 0, '天空飘来五个字:怎么都不行。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (422, 0, '当失去工作动力的时候，就看看银行卡余额吧。之后你就会发现：工作根本没卵用。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (423, 0, '曾经的海枯石烂，抵不过好聚好散。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (424, 0, '以前虽然穷但很开心，现在就不同了，现在不仅穷还不开心。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (425, 0, '有钱有脸叫男神，有钱没脸叫老公，没钱没脸，你是个好人啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (426, 0, '将薪比薪的想了想，算了，不想活了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (427, 0, '你要么非常努力，要么非常聪明，才能勉强过上平庸的生活。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (428, 0, '爱笑的姑娘运气都不会太差。运气差的姑娘根本笑不出来！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (429, 0, '所谓的你会等到那个对的人，就是到了结婚年龄随便找个人嫁了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (430, 0, '遭遇指责不要急于争辩，先反思自己，便于想清楚如何甩锅。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (431, 0, '不要再说自己是一条单身狗，其实，你可能比不上狗…', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (432, 0, '跌倒了，爬起来再哭。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (433, 0, '没有人关心你飞得多高，倒是有一群人等着看你摔得多惨。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (434, 0, '破罐子不能破摔，得使劲摔！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (435, 0, '有时候你不逼自己一把怎么知道自己做不到。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (436, 0, '爸爸养过的鸟、兔子、鱼、松鼠、发财树等等的都死了，我和哥哥很庆幸。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (437, 0, '感情是可以磨合的，前提是，看脸。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (438, 0, '事事如意料之外，年年有余额不足！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (439, 0, '善良没用，因为只有你先漂亮，别人才能看到你的善良。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (440, 0, '遇到挫折，服个软低个头其实没什么的，反正你头上也没有皇冠。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (441, 0, '听说你的城市下雨了，不知道你有没有带伞，如果没有的话，我希望下的是刀子。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (442, 0, '人都有幸福的权利，但少数人有幸福的能力。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (443, 0, '如果再见不用红着脸，是否还能借点钱', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (444, 0, '曾梦想仗剑走天涯 后来手机没电就没去(๑¯∀¯๑)', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (445, 0, '穷你就努力啊！不努力折腾，你怎么负债百万。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (446, 0, '低头吧，你根本就没有皇冠。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (447, 0, '不尝试问一次，你怎么知道，你不是爸妈避孕失败的结果？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (448, 0, '打工钱少就出来创业吧，保证能让你，赔个精光。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (449, 0, '你们之所以喝鸡汤，是因为肉被别人吃了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (450, 0, '难受的时候摸摸自己的胸，告诉自己是汉子，要坚强。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (451, 0, '有些人感慨：自己岁数不小了，还没有成熟起来。其实你们已经成熟起来了，你们成熟起来就这样。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (452, 0, '说明星可怜的人，有看过自己银行卡的余额吗？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (453, 0, '别人有成就才说平凡可贵，你那是碌碌无为。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (454, 0, '你要喜欢一个女生，就从现在好好学习，好好努力工作，等她结婚的时候多出一份份子钱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (455, 0, '没有外表，谁TM看你内心啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (456, 0, '不经历风雨，怎么迎接暴风雨。暴风雨之后，不仅没看到彩虹，还感冒了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (457, 0, '当你觉得生活对你不公时，秤秤体重，照照镜子，你会觉得一切又合乎情理。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (458, 0, '多年过去，再回忆高考，其实本质上没有考到好与坏的说法，重要的是年轻人在一起，做份试题，然后决定去哪座城市打王者荣耀。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (459, 0, '心比天高，命比纸薄。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (460, 0, '如果上天没有给你想要的，不是你值得拥有更好的，而是你不配。别以为今天是你人生的低谷，在你未来的日子里它都能算的上是巅峰了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (461, 0, '灰姑娘嫁给了王子，但请不要忘记她也是伯爵的女儿。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (462, 0, '聽說七月鬼門快開了，你總算不是孤家寡人了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (463, 0, '上帝再给你关上一扇门的时候会顺手给你把窗也堵上没错就是让你撞墙啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (464, 0, '生活里不缺乏狗血剧情，可是一定要记住，你才是你人生的作者，何必把剧本写得苦不堪言。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (465, 0, '你还是别把我放在心里了，我不喜欢人多的地方。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (466, 0, '努力不一定成功，但是不努力真的很轻松。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (467, 0, '有人说世上百分之九十九的事都能用钱解决，但他们没告诉你剩下的百分之一需要更多的钱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (468, 0, '不想一直被别人否定，那就要经常自我否定。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (469, 0, '現在矮矬窮不要緊，要相信將來有一天，你會變成矮矬窮老…', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (470, 0, '本来无望的事，大胆尝试，敢于突破，最终会证明真的无望。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (471, 0, '放假买个地球仪吧，世界那么大你不但可以看看，还可以转转。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (472, 0, '你费尽力气想明白了一些事情，但对解决它们一点儿帮助也没有。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (473, 0, '你只看到有些人表面上风光无限，却不知道他们背地里，也顺风顺水。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (474, 0, '上帝七天创造世界，剩下的时间呢？ 补bug。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (475, 0, '三分天注定，七分靠打拼，还有90分看脸。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (476, 0, '没有钱包的充实，哪来内心的宁静。很多人都本末倒置了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (477, 0, '我因为穷，所以国庆在家，躲过了一节。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (478, 0, '凌极水穷之处，坐看风起云涌。好好活下去，每天都有新打击。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (479, 0, '你只看到他们挥金如土，却看不到他们背后日进斗金。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (480, 0, '有的人穷的以为时候有钱会很快乐，等他真的有钱了，才发现有钱确实很快乐', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (481, 0, '“不要说读书没用，只是你读书没用，本质上是你没用。”', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (482, 0, '有时候，你最想得到的人，其实是你最应该离开的人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (483, 0, '你这么努力，忍受那么多寂寞和纠结，我们也没觉得你有多优秀。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (484, 0, '人生没有过不去的坎，只有一坎接一坎。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (485, 0, '武则天证明了，成功和性别没关系，你证明了成功和你没关系。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (486, 0, '小时候我们经常被教育说不要追求金钱，还嘲笑那些有钱人，说他们穷得只剩下钱。长大后才发现，我们自己穷得连钱也没有啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (487, 0, '有钱者，事竟成。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (488, 0, '生活就像海绵里的水，只要你不愿意挤，总有一天会蒸发完的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (489, 0, '不想结婚生子，是我作为穷人的自觉。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (490, 0, '他给你的爱会消逝，他给你的TIFFANY却不会贬值。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (491, 0, '上帝为你关上门，一定会为你打开一扇窗，可惜你太胖。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (492, 0, '普通人结婚的另一半其实并不欣赏自己，只不过找不到更好的人。他们真正欣赏喜欢的，另有其人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (493, 0, '假如生活欺骗了你，很可能你自己都不知道……', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (494, 0, '既已背影倾天下，何必转身乱芳华。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (495, 0, '人就是不能闲的，不然努力一下都以为自己在拼命。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (496, 0, '小明和小红陷入爱河，第二天村里人把他们俩从河里捞了出来。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (497, 0, '成绩不好别着急，只要你肯坚持，一定能把前面的人熬走', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (498, 0, '我生气的时候你一定要哄我，买吃的给我。等老子吃饱了打死你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (499, 0, '比三观更重要的是五官。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (500, 0, '学校教学楼厕所放镜子你以为让你整理仪容？你错了，是为了让你知道，人丑就要多读书。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (501, 0, '一分耕耘一分收获，够老了吧。要是世界上所有事都可以考努力做到，那多美好。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (502, 0, '如果你的前半生过得很坎坷，也不必太担心，下半生你就会适应的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (503, 0, '男女之间很少有纯友谊。小船要么沉底，要么升舱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (504, 0, '看著面善的，不一定是好人，還有可能是诈骗集团。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (505, 0, '所谓的\"不要让孩子输在起跑线上\"是没有意义的，因为你就是起跑线本人，你的孩子早就输了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (506, 0, '别人高处不胜寒，我们是低处纳百川。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (507, 0, '去年给自己定了目标存款3万，今年掐指一算，还差5万。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (508, 0, '很多时候你不拼一把，你根本不知道，你还有把事情搞砸的本事。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (509, 0, '我们都是浩瀚宇宙中渺小的一员，但我们还是不断遇到宇宙中最自以为是的生物，也就是人类。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (510, 0, '有些人表面光鲜亮丽，实际上，船袜已经滑到了脚底板。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (511, 0, '人生苦短，我又他妈懒。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (512, 0, '有时候不努力一把，你都不知道什么是绝望。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (513, 0, '一提到钱，大家就不是那么亲热了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (514, 0, '别减肥了，你丑不仅是因为胖。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (515, 0, '如果全世界都不要你了，你要记得还有我，我也不要你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (516, 0, '人生不如意，十之有十。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (517, 0, '别人是金子总会发光的，而你，总会花光的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (518, 0, '没有人能够让你放弃梦想，你自己试试，就会放弃了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (519, 0, '哪怕是咸鱼也要有梦想，打滚儿翻身什么的味道更好一点。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (520, 0, '别人问你有谈恋爱吗？就说现在没有。可以机智地掩盖过去也没有的事实。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (521, 0, '你以为你感动了地球，其实只是温暖了自己。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (522, 0, '“为什么要怕鬼，害你的全是人。”', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (523, 0, '别看我平时对你漠不关心，其实背后有说你好多坏话的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (524, 0, '我卧底五年成了老二，再卧底下去，我怕会成为老大！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (525, 0, '女生的冷暖自知什么的，在长得好看的面前都弱爆了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (526, 0, '你要是过得好，我怎么能睡得着。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (527, 0, '当你失败的时候，身边会有一群关心你的人，他们会问你发生什么事，听听你的失败经验，然后心满意足地离开。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (528, 0, '其实你也有超能力，怎么减都不瘦的能力。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (529, 0, '大家都以为我没什么朋友，事实上，我确实没朋友', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (530, 0, '你必须为自己的言行负责，但是老师不用。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (531, 0, '你以为他是不会表达，其实他就是不爱你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (532, 0, '你从来不孤独，因为，孤独都不想跟你交朋友。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (533, 0, '你不会真的以为你高中时候没有早恋是因为老师和家长禁止吧？！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (534, 0, '他只是暧昧成瘾、而你却走了心。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (535, 0, '我决定从今天开始戒酒，以后如果再喝，我自罚三杯。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (536, 0, '不合适就是穷，没感觉就是丑，一见钟情就是好看，深思熟虑就是有钱。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (537, 0, '如果你对目前的工作不太满意，觉得事业发展到了一个瓶颈，那么就去进修一个更高的学历吧，这样的话，毕业以后你就会明白，之前的失败跟学历似乎没什么关系。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (538, 0, '虽然你单身，但是你胖若两人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (539, 0, '许多人说选择北上广的原因，是发展机会好。但他们说的发展，实际上指的就是打工。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (540, 0, '你在最好的年纪里遇不到任何人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (541, 0, '干干净净没故事 一个酷字贯穿一生。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (542, 0, '如果你知道一些事情有意思，但不能去做而失落，那还好;要是觉得什么都没意思，应该就是抑郁症。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (543, 0, '心灵鸡汤是给吃惯了鲍参翅肚的人做的换口味小菜，屌丝以为喝一碗鸡汤就营养全面提升了？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (544, 0, '你以为只要长得漂亮就有男生喜欢？ 你以为只要有了钱漂亮妹子就自己贴上来了？ 你以为学霸就能找到好工作？ 我告诉你吧，这些都是真的！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (545, 0, '你认真的样子，就像天桥上贴膜的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (546, 0, '很多时候别人对你好，并不是因为别人喜欢你，而是他喜欢对别人好。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (547, 0, '努力不一定成功，但是不努力真的好舒服啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (548, 0, '曾经我想做个特别的人，现在我成功了，我现在特别难过又无助。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (549, 0, '世界上脑残那么多，你却成了佼佼者。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (550, 0, '学校并不比社会简单，人闲事就多。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (551, 0, '别灰心，人生就是这样起起落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落落的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (552, 0, '不逼自己一把，你都不知道，什么叫绝望。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (553, 0, '咸鱼翻身有什么用，翻了身，还是咸鱼。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (554, 0, '很多人闯进你的生活，只是为了给你上一课，然后转身离开。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (555, 0, '失败是成功之母，但失败往往不孕不育。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (556, 0, '没人牵手，我就揣兜。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (557, 0, '若你没厮守一生的决心，请不要爱上我这么一个人。写这首歌的人实在太恐怖。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (558, 0, '人都需要努力的，努力过后你就会发现，你还真的是很普通。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (559, 0, '勇敢面对磨难，那些杀不死你的，顶多是让你留下残疾。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (560, 0, '以前觉得颜值高身材好的网红多半只是花瓶，接触之后才发现，人家不但样样比你强,还你跑得快。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (561, 0, '不要说生活伤害了你，生活连你是谁都不知道。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (562, 0, '以前我每天都会买彩票，终于有一天，我连彩票都买不起了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (563, 0, '也许睡眠，才是人类真正的活动形态，难怪我总是睡不醒。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (564, 0, '我交朋友，从不在乎他有没有钱，反正都没有我穷。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (565, 0, '我鼓足勇气去面对现实，却发现勇气，真的只是气而已。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (566, 0, '好人成佛需要九九八十一难，可是坏人只需要放下屠刀。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (567, 0, '旅行不必在乎目的地，在乎的是沿途的风景。因为就你那点钱也就只够买个往返火车的硬座票了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (568, 0, '小时候的我们很快乐。因为小时候穷和丑没有现在那么明显。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (569, 0, '用心品味当下每一分痛苦，这样在离世时才不会有所留恋。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (570, 0, '我不是诸葛亮，也没有草船，但为何你的贱一直往我这放？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (571, 0, '这年头，哪有不分手的恋爱，只有不伤手的立白。遇事得看开一点。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (572, 0, '所谓的女汉子，只不过是因为长得丑而已，但凡有些爷们气质的漂亮姑娘，都被称为女王大人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (573, 0, '越是没有能力改变自己生活的人，越喜欢批评别人的改变。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (574, 0, '没有人能让那你放弃减肥，你自己想想就会放弃了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (575, 0, '山重水复疑无路，柳暗花明又一坑。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (576, 0, '真的不能熬夜了，打开支付宝都看不到钱了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (577, 0, '爱笑的姑娘，总是比别人更容易长眼纹，干纹，细纹，鱼尾纹。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (578, 0, '有些年轻人，一毕业就到某些大型国企和机关中工作。每天没什么事儿，就是吃饭喝酒，福利好得不得了。人生还没有奋斗过就开始养老，自己的理想被丢在一旁，用民脂民膏来享受特权。对于这样的年轻人，我只想问你们四个字：哪投简历?b', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (579, 0, '你任何为人称道的美丽，都有ps的痕迹。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (580, 0, '心软不是病，回头才致命。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (581, 0, '做事一定要执著，一直向前走，无非就是碰壁，可你遇到的老是悬崖。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (582, 0, '如果你长得很丑，人们会因此而喜欢你，因为你比他们还丑。但是大家并不会因此而爱你和你在一起，因为你比他们还丑，这样一来，你注定要孤独一生了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (583, 0, '人丑就要多健身，这样就能在别人说你丑时，你可以揍他。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (584, 0, '好女孩只得到一个好字，心机girl却得到所有。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (585, 0, '对女人强吻表白一般会有两种结果，一种是啪，一种是啪啪啪。这就是屌丝和高富帅的差距。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (586, 0, '儿孙自有儿孙福。你都没活出个啥样，咋样，你生下下一代，他就能突破基因有福啦？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (587, 0, '你家住海边吗？这么浪。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (588, 0, '女生们宁肯做高帅富的备胎，也不肯接受屌丝的行为，从基因上保证了人类的进步。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (589, 0, '好看的皮囊你养不起，有趣的灵魂看不上你', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (590, 0, '100次心动不如一次行动,行动之后，心就不会再动了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (591, 0, '如果你真的想要做好一件事，全世界都会为你挡路。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (592, 0, '一些人追求卓越是因为他们天性如此，且能力出众。很多其他人却也喜欢跟着凑热闹。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (593, 0, '懒是一个很好的状态，可以掩饰你即使努力也一无是处的事实。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (594, 0, '生活不止眼前的苟且，还有长远的凑合。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (595, 0, '白雪公主的故事告诉我们，七个小屌丝对她再好也比不过高富帅的一个吻。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (596, 0, '红颜何曾真知己，人生无聊才读书。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (597, 0, '好多重要又紧迫的事情，先干哪一件都会感觉别的事情被耽误了。所以还是先上会儿网吧。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (598, 0, '如果你的人生苦不堪言，请不要气馁，坚强地活下去。不然你怎么知道以后会不会更苦呢？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (599, 0, '早上醒来，我以为自己长大了，原来是被子盖横了～', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (600, 0, '奉子成婚，就是现实生活中的“你弄坏的，你就得买。”', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (601, 0, '遇见你竟花光我所有运气——TM遇见你之后一直在倒霉。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (602, 0, '今天一天过得不错吧？梦想是不是更远了？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (603, 0, '觉得自己总碰不到美好的人和事，并不是别人眼瞎老天故意整你，恰恰是因为你不够好，他们都在躲你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (604, 0, '知道为什么天妒英才吗？ 因为没人去管笨蛋活了多久。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (605, 0, '我的眼里只有你，因为你的大脸，让我看不到别人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (606, 0, '以前跪着挣钱很少，于是我也模仿那些优秀的人，试着站起来，结果饭碗就丢了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (607, 0, '我太好了，好到跟谁谈恋爱都是浪费，好到谁都配不上我，好到我只能自己对自己好，好到注定孤独一生。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (608, 0, '长得高的人只和长得高的人约会，所以，如果你是个矮子的话，就不要费劲往上看了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (609, 0, '吃完苦中苦，我终于成为了人下人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (610, 0, '只要坚持一下，一事无成的一年又过去了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (611, 0, '虽然我长得丑，但是买了漂亮衣服，我就可以丑的漂亮。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (612, 0, '要么读书，要么旅行，身体和灵魂，必须有一个要去工作。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (613, 0, '父母一直注重对我的品德教育。到了社会上，我按照父母教我的接人待物，却发现自己并不受人待见。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (614, 0, '当我一天只能撸两管的时候我才意识到我真的开始老了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (615, 0, '生活不止是眼前的苟且，还有明天的苟且和后天的苟且。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (616, 0, '有时候，别人对你很冷淡，可能并不是你的问题。他也许只是不喜欢长得丑的人而已。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (617, 0, '你在进步，你的对手也在进步，你永远追不上TA。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (618, 0, '俄罗斯方块教会我们：如果你合群，就会消失。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (619, 0, '世界上不是很公平吗?强者拥有一切，弱者不配拥有一切。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (620, 0, '车到山前必撞树，船到桥头自然沉。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (621, 0, '天将降大任于斯人也，必先苦其心志劳其筋骨，后来天改主意了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (622, 0, '别看我挣的少，但是我省的多，昨天法拉利又省下两百多万。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (623, 0, '和对象吵架，先不要追究吵架原因，要弄明白他胆子怎么肥了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (624, 0, '世上最远的距离就是：我想和你叙叙旧，你却问我要不要代购。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (625, 0, '当你失败的时候，身边一定会有一群朋友，他们会关切你遇到的事情，然后带着经验离开。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (626, 0, '人人都想上天堂，却没有人想死。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (627, 0, '机会是留给有钱的人的？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (628, 0, '如果你有什么事，一定要告诉我，反正我也解决不了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (629, 0, '你努力过后才发现，智商的鸿沟是无法逾越的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (630, 0, '想做什么就放心大胆去做，反正会后悔。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (631, 0, '人的眼光要放长远一点，你看看前路，是不是更加绝望了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (632, 0, '生活不止眼前的苟且，还有读不懂的诗和到不了的远方！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (633, 0, '当你瘦下来之后，你会发现原来你的丑，跟减肥并没有关系。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (634, 0, '谁说你没有毅力的，单身这事你不就坚持了好几十年吗？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (635, 0, '给你喜欢的人发消息，她（他）很久都没回，不要纠结人家是不是在忙，而是她（他）只是在和别的男人（女人）聊天。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (636, 0, '永远不要自暴自弃，一旦开始放弃，你就会发现非常开心。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (637, 0, '不是所有成功男人背后都有一个女人，大多成功男人在成功之前是没有女人的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (638, 0, '梦想还是要有的，万一见鬼了呢？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (639, 0, '心狠手辣的小明，舔了一下自己的手指，被辣哭了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (640, 0, '都市安放不了灵魂，家乡容不下肉身。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (641, 0, '你不能因为你胖，就忽略了你的丑。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (642, 0, '趁着年轻多出来走走看看，不然你都不会知道呆在家里有多爽。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (643, 0, '爱你的人总担心你吃的饱不饱，而我们不一样，我们不爱你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (644, 0, '现在吃苦，是为了让你习惯以后吃更多苦。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (645, 0, '法制与道德就是站在顶峰的人，给弱者制定的规则，而强者一般无视规则。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (646, 0, '那些能够彼此帮忙托关系的友谊，比那些天天在一起就是扯淡吃喝旅游的友谊，要强得多。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (647, 0, '每天对着镜子说一句你很棒，不久后，那镜子就会成为很棒的镜子。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (648, 0, '失恋之后快打起精神，毕竟，还有下一个渣男在等着你。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (649, 0, '都说强扭的瓜不甜，但是我为什么要管它甜不甜呢，我又不吃瓜，我只是喜欢扭而已！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (650, 0, '很多人每天都精神抖擞去奋斗，仿佛全世界都在等着看他成功似的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (651, 0, '狗是人类最好的朋友。然而狗最好的朋友是「屎」。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (652, 0, '每天看着189邮箱收到的电子账单，只想到用6位数的密码守护好2位数的存款。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (653, 0, '一个人如果没有梦想，跟无忧无虑有什么区别呢？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (654, 0, '爱迪生千百次寻觅灯丝，就是为让你，当上耐用的电灯泡。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (655, 0, '你没有任何的话语权，除非说的是正确答案。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (656, 0, '很多时候别人对你好，并不是因为别人喜欢你，而是因为他们喜欢对人好。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (657, 0, '求个明白人，问条不归路。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (658, 0, '我们所咒骂的那些品德败坏的人，其实不过是直接或间接地损害了我们的利益，或者做了我们想做而不敢做的事。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (659, 0, '曾经我也是打算靠脸吃饭的，后来差点饿死才放弃的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (660, 0, '上帝是公平的，给了你丑的外表，还会给你低的智商，以免让你显得不协调。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (661, 0, '我18岁背井离乡，从此村里人再也没有喝上过水。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (662, 0, '不要在意现在的低谷，未来还有很长的下坡路要走。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (663, 0, '别人都散发着恋爱的酸臭味，只有我，散发着单身狗独有的清香。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (664, 0, '做一个对社会有副作用的人~', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (665, 0, '要感谢那些把你打倒的人，因为你会发现躺倒真的很舒服', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (666, 0, '是金子到哪里都发光。 可是你是「石头」啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (667, 0, '有很多遗憾，后来我们叫它美丽的错误。可也许你坚持去做了，现在就只剩下了错误。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (668, 0, '我每天拼了命的努力就是为了向那些看不起我的人证明他们是对的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (669, 0, '不要年纪轻轻的就以为自己已经进入了人生低谷，你还有很大的下降空间。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (670, 0, '我不信星座，因为我是射手座，天性多疑。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (671, 0, '很多时候，不逼自己一把，你就不会知道自己还有把自己搞砸的本事。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (672, 0, '别低头，多层下巴会暴露。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (673, 0, '成功不了就是因为你各方面都太垃圾了，哪来那么多原因。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (674, 0, '你是个做事认真的人，认认真真地帮别人，试了所有的错。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (675, 0, '有钱人离我好近，有钱离我好远！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (676, 0, '我从不去想何时能成功，既然选择了远方，那就还远着呢。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (677, 0, '坏女人爱男人的钱和权;好女人爱男人因有钱和有权儿产生的自信、宽大、精力充沛、乐观进取。还好，殊途同归。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (678, 0, '敬往事一杯酒，再爱也不回头。 求你回头看看吧，往事都「吐」了！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (679, 0, '念念不忘必有回响，得了吧......人家早把你忘了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (680, 0, '是金子，早晚会发光。是石头，到哪里都不会发光。就算你是金子，早晚也会花光。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (681, 0, '没有什么事情能把人一次击倒，只要足够坚强，它会持续的把你击倒。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (682, 0, '世界这么大，我想去看看，看看有没有塑料瓶。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (683, 0, '无毒的身躯扛下有毒的疫苗，你是教育我从小就要坚强！', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (684, 0, '抱怨不会改变生活，但是钱可以。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (685, 0, '家有一老，如有一宝，说的只是有高额退休金的老人。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (686, 0, '你才二十多岁，没有遇到喜欢的人很正常，往后你会发现，大概是遇不到了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (687, 0, '失败乃成功之母，但往往失败都是不孕不育。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (688, 0, '当你蹲下再站起来时，听到膝盖发出声响，那你要注意了，这说明你的听力挺正常的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (689, 0, '灵魂已出窍，躯体有何用。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (690, 0, '有钱了不起啊？有钱，真的了不起。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (691, 0, '何以解忧，唯有暴富。如果暴富太难，那退一步，暴饮暴食也行。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (692, 0, '别人没回复，继续等，你会等到她的朋友圈。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (693, 0, '忍受孤独比忍受傻逼简单多了', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (694, 0, '我妈说，自从黄渤红了有钱了之后，看起来都眉清目秀了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (695, 0, '长得漂亮的女孩发脾气是磨人的小妖精，丑的就是，丑八怪你吃炸药了？', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (696, 0, '好身材的因素很多。不是节食和锻炼就能拥有好身材的。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (697, 0, '尽量不要和比自己生活质量高的人起冲突，不论你是假装若无其事、努力争辩或者破口大骂，在别人看来，都是自己很可笑并且已经输了。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (698, 0, '那些人人羡慕的精英，其实过得并不如你想象的那样好。但肯定比你是强得多。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (699, 0, '虽然我长得丑，但是我想得美啊。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (700, 0, '生活不止眼前的苟且，还有前任的请帖。', '2019-04-13 17:40:27', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (701, 0, '那些说为了自己而活的人，有一部分是连为别人而活的机会都没有才说出来的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (702, 0, '是金子总会花光的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (703, 0, '不知道你越过多少峰才成功，反正你逃不过早晚两个高峰。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (704, 0, '瘦下来还这么丑，真是没救了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (705, 0, '条条大路通罗马，每条都有收费站。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (706, 0, '用美颜手机自拍多了，越来越不知道，自己有多丑了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (707, 0, '你总想等你优秀了再去向她表白，后来才发现你这样的人怎么可能优秀呢。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (708, 0, '诗和远方越远越脏，以梦为马越骑越傻。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (709, 0, '别人一看你就说你是学生，不是因为你看着年轻，而是因为穿的土！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (710, 0, '“假如我又丑又穷又矮又笨，你还会爱我吗？” “别他妈假如了，你本来就又丑又穷又矮又笨。”', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (711, 0, '谁说女追男隔层网，除非那男的本来就对你有好感，不然隔的基本都是铁丝网，还是带电的那种。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (712, 0, '一些人的情商比较低，没法扮演好自己的社会角色，只能一直以最真实的自己面对世界。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (713, 0, '小时候，我们都有各种各样的梦想。但随着年龄的增长，梦想离我们越来越远，有时候不是我不想努力，而是我渐渐发现，有些事不是你努力就可以达到的！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (714, 0, '你只知道人家化妆比你好看，却不知道，她们卸了妆，不仅比你好看，皮肤还吹弹可破。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (715, 0, '强扭的瓜不甜，但是有瓜吃呀。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (716, 0, '你在我心里，就像天上的星星，多一颗少一颗都无所谓。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (717, 0, '麻麻跟我说只有没有生育能力的人才会随便叫别人儿子。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (718, 0, '谁说功夫不负有心人，路星河求了56次婚，都不及余淮的一句“耿耿，我来晚了！”', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (719, 0, '工作爱情生活不顺？多照照镜子，很多事情你就明白了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (720, 0, '其实找谁做女朋友都差不多，都是在不停地争吵。只不过一些人是和比较漂亮的女孩子在争吵。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (721, 0, '想买一辆保时捷卡宴，请问买过的朋友，你们的钱都是从哪里来的！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (722, 0, '有时候不努力一下，都不知道自己还有把事情搞砸的能力。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (723, 0, '听成绩的时候要用右耳听，因为左耳靠近心脏，可能会猝死。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (724, 0, '你的计划，就像零食，吃到肚子里之后就是个屁。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (725, 0, '你倒下了，能顶替你的人千千万。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (726, 0, '当你厌恶了对方，自己又找不到下家，“为了孩子”可能是个不错的借口。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (727, 0, '逼急了，我可是什么都做的出来的！那刚好，这还有个需求！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (728, 0, '世界那么大，不爱你的人那么多。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (729, 0, '爱一个人一定要告诉她，那样你才会知道，她有多讨厌你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (730, 0, '富人生活千姿百态，穷人大致相同。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (731, 0, '不要相信小说中穿越了就能泡上美男走上人生巅峰，一般来说穿越了你连字都看不懂。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (732, 0, '不经历风雨，怎么迎接暴风雨。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (733, 0, '如果你觉得每天都累成狗，那你就错了，狗都没你这么累。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (734, 0, '有的时候一场说走就走的旅行归来后，除了该做的事情被拖延的更久了，什么都没有改变。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (735, 0, '其实根本没有真正高冷的人，只不过人家暖的不是你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (736, 0, '曾经的搬砖少年，通过不懈的努力，现在能搬更多的砖了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (737, 0, '如果你每天干的活明显多于别人，但自己很高兴还感觉得到器重，那么与其说你很有才干，不如说你的领导很会管人。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (738, 0, '有人出现在你的生命里，是为了告诉你，你真好骗。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (739, 0, '别人能继承他爸的家业，而你只能继承你爸加夜班的优良传统。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (740, 0, '只要是钱能解决的问题，我一个都解决不了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (741, 0, '人生就是大起大落落落落落落落落落落的过程。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (742, 0, '那些杀不死你的，让你老老实实地活着。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (743, 0, '你的努力程度，还远远谈不上拼天赋。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (744, 0, '真正的善良总是被利用，而善于表演善良的人总是最终的受益者。所以，果然脑子比人品重要。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (745, 0, '吃得苦中苦 心里会更堵。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (746, 0, '有时我们觉得别人误会了自己，其实是我们误会了自己。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (747, 0, '等忙完这一阵，就可以接着忙下一阵了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (748, 0, '不要借太多钱给一个人，那会让你变得很穷。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (749, 0, '懒是一个很好的托辞，说的好像你勤奋了就能干成大事一样。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (750, 0, 'Follow your heart，翻译成中文就一个字，怂。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (751, 0, '把女孩子弄哭是很没种的事情，把男孩子弄哭是一件叼爆的事啊。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (752, 0, '悲剧分为两种，一种叫悲剧，一种叫没钱。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (753, 0, '只有拥有找男女朋友的能力和很多备胎，才能真正享受单身生活。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (754, 0, '一无是处时，别绝望，因为至少你的判断还是对的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (755, 0, '可是这个世界上，有些人光活着就已经拼尽全力了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (756, 0, '现在的人天天手机不离手，要回你消息早就回了，单身没关系，以后单身的日子还长着呢。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (757, 0, '人生和骑自行车不同，就算走下坡路，也不会轻松。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (758, 0, '我希望什么都来得很容易，变成废物也没关系。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (759, 0, '强扭的瓜不甜，不过甜不甜不重要，强扭，就很爽啊。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (760, 0, '你以为选择填空做的烂就无药可救了吗？你大题也做不出来，作文还跑题，听力也很差啊。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (761, 0, '单身最好的一点是，当你脱光衣裳，失望的人只有你自己。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (762, 0, '人丑就要多读书，反正你也没别的事做了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (763, 0, '退一步海阔天空。我不信你在天空下掉下来，或掉进海里你不会死。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (764, 0, '从心而怂。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (765, 0, '没有你想不到，只有你做不到……', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (766, 0, '我有个朋友，在几年前停止了抱怨和自怨自艾，开始努力改变自己。到今天，他的物质生活和精神状态都没有什么改善。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (767, 0, '过的不顺的时候，要相信你不是一个人，看看身边的朋友，不都是因为失败，才混在一起的么。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (768, 0, '只要你每天坚持自习，认真刻苦，态度端正，忍受孤独，最终的胜利肯定是属于那些考场上发挥好的人。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (769, 0, '靠父母你是公主，靠男人你是王妃，靠自己你是乞丐。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (770, 0, '世界上有六十亿人，你一点都不特别，你要是真想跟异于常人，那你只能倒着走路了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (771, 0, '女生之间的友谊啊，就像塑料花，虽然假但永不凋零。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (772, 0, '人不犯我，我不犯人，人若犯我，我就碰瓷儿。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (773, 0, '咸鱼，总有翻身的一天。但翻身之后还是咸鱼。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (774, 0, '男生都是看脸的？不，很多男生对待爱情还是看内在美的，但看内在美的前提是，你有一张美丽面容。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (775, 0, '上帝向人间洒满智慧，唯独你打了把伞。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (776, 0, '要记得面向阳光，这样才看不见身后的阴影和晒黑的脸。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (777, 0, '我的脑袋不是空的。我是要大作为的人，只是混沌初开。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (778, 0, '强扭的瓜不甜，谁说我要吃了,我只是玩玩。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (779, 0, '一觉醒来，是不是感觉离梦想又远了呢。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (780, 0, '公主病的成因有两个，要么丑要么穷。那些又漂亮又有钱的呢？那本来就是公主好嘛！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (781, 0, '行而上学，实在不行就别上了吧。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (782, 0, '爱笑的女孩运气都不会太差...因为啊，运气差的通常也笑不出来...', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (783, 0, '如果你喜欢一个女孩，就好好努力多挣钱，到时候多随点份子钱。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (784, 0, '有什么事都推到明天吧，万一明天我死了呢。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (785, 0, '玩游戏，输赢不重要，重要的是要赢。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (786, 0, '我的原则，只有三个字，看心情。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (787, 0, '我到底是活了16年，还是活了1天，重复了16年？', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (788, 0, '真正的财富是你的思维，不是你的收入，因为你的收入实在太少了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (789, 0, '有人一笑就很好看，你是一看就挺好笑。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (790, 0, '我不怕变成自己所厌恶的人，我怕过得还不如他们。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (791, 0, '最靠得住的是有钱，最靠不住的是人心。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (792, 0, '我连穷和丑都不怕，还怕单身？', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (793, 0, '人生没有过不去的坎，只不过是过去一个又接着一个。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (794, 0, '成功的路上，我走的很慢，但从不后退，后面的大哥能补能别滴我。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (795, 0, '人家谈恋爱，靠长相靠浪漫靠烧钱，而你靠对方眼瞎。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (796, 0, '天涯何處無芳草，全都長在別人家。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (797, 0, '相由薪生。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (798, 0, '他没那么爱你，只是睡你比嫖来得便宜。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (799, 0, '你在哭吗？ 没有，我只是过敏了。 对什么过敏？ 人生。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (800, 0, '等你生活中真有了生老病死这样的大事，才会知道自己以前半夜的忧伤都是狗屁。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (801, 0, '待你长发齐腰，记得拉屎要撩哦。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (802, 0, '胡思乱想能瘦身的话，我现在可能已经，只剩下灵魂了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (803, 0, '生活将我们磨圆，不是为了别的，只是为了能让我们滚的更远！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (804, 0, '贵不是iPhone的缺陷，穷是你的缺陷。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (805, 0, '回首青春，我发现我失去了很多宝贵的东西。但我并不遗憾，因为我知道我以后还要失去更多。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (806, 0, '很多人不是心理疾病，而是心理残疾，治不好的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (807, 0, '别总自称单身狗了，按年龄你是单身鳖，按智商你是单身傻狍子。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (808, 0, '别总骂恨铁不成钢，是你自己忘了，铁本来就不能成钢的啊。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (809, 0, '生活不止眼前的苟且，还有旧爱发来的请帖。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (810, 0, '“这孩子不是笨，就是学习方法不对。” “学习方法都找不对还不是笨啊？”', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (811, 0, '你承受的苦难并不比他人多太多，痛苦主要来自敏感和脆弱。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (812, 0, '长的好看确实可以当饭吃，你是不是明白自己为什么老饿了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (813, 0, '生活已经如此艰难，在哪里跌倒就到哪里躺下吧。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (814, 0, '生活不止有眼前的苟且，还有今后的苟且，还有你看不懂得诗，和你到不到了得远放。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (815, 0, '穷不可怕，可怕的是，最穷的人是我。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (816, 0, '今晚吃鱼吧，我看你挺会挑刺的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (817, 0, '你以为现在已经很糟了？不，更糟的还在后面。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (818, 0, '“为什么我总是感觉自己特别普通?”“可能是因为你确实比较普通吧。”', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (819, 0, '人活着就会失去，你失去的不会再来，你争取的永远都会失去！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (820, 0, '别一天到晚想着减肥，你的嘴同意你这样想了吗？', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (821, 0, '有些妹子喜欢带上墨镜自拍。其实再戴上口罩，会显得更美。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (822, 0, '很多时候，乐观的态度和好听的话帮不了你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (823, 0, '当傻逼只会造成少量痛苦，大量的痛苦来自于自己是傻逼，还努力不让别人知道。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (824, 0, '虽然我学的慢，但是我放弃的快啊。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (825, 0, '你要是喜欢一个女生，就好好学习找个好工作努力挣好多好多钱，等她结婚的时候你多出点份子钱。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (826, 0, '别向生活抱怨什么，因为生活根本不知道你是谁。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (827, 0, '是这样的，风水轮流转确实不假，但你在轴心上这就很尴尬了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (828, 0, '虽然你长得丑，但是你想得美啊！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (829, 0, '你以为今天是最糟的一天么，明天会让你改变这个看法的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (830, 0, '别说你一无所长，熬夜玩手机你可是一把好手。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (831, 0, '化再好的妆，也盖不住你，卸妆后的丑。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (832, 0, '世界上本没有鸡汤，鸡死了，便做成了鸡汤。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (833, 0, '有的人是来爱你的，有的人就是来给你上课的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (834, 0, '一场说走就走的旅行归来后，除了钱花光了，该做的事情被拖延的更久了，什么都不会改变。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (835, 0, '只有看尽人世繁华并且有能力随意享受繁华的人才有资格说淡泊名利之类的话。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (836, 0, '失败不可怕，可怕的是，你还相信这句话。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (837, 0, '不努力的女生，会有买不完的地摊货，逛不完的菜市场。努力的女生，你就没时间逛地摊，因为你只能加班叫外卖、逛网店！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (838, 0, '一场说走就走的旅行，回来等着你的就是一段吃土的日子。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (839, 0, '每次面对美食，我都告诫自己：“吃多了会死。”但结果证明，我根本就不怕死。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (840, 0, '鸡汤是你的幻想，毒鸡汤才是你的现状。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (841, 0, '假如今天生活欺骗了你，不要悲伤，不要哭泣，因为明天生活还会继续欺骗你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (842, 0, '我爱你，你好，请问你是？', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (843, 0, '一无所有到，没有什么可以放弃时，别忘了你还能放弃治疗。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (844, 0, '为什么总是天妒英才呢？因为没人管笨蛋活多久。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (845, 0, '王子拿着留下的43码水晶鞋陷入沉思。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (846, 0, '出身好的努力是为了成功，而你是为了活下去。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (847, 0, '人生好难哦，但还是要保持围笑。因为更难的日子还在后面呢！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (848, 0, '不要以为世界抛弃了你，世界根本没空搭理你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (849, 0, '拉肚子的时候，不要相信任何一个屁。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (850, 0, '你年轻时一事无成;时而自怨自艾颓废堕落，时而咬紧牙关拼命努力，经营关系，但你的生活一直没有改善，你一直很痛苦，直到三十岁，三十岁以后你就习惯了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (851, 0, '年轻人总是有干劲，却没有长性。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (852, 0, '秋天是收获的季节。别人的收获是成功与快乐，你的收获是认识到并不是每个人都会成功与快乐。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (853, 0, '错把放纵当潇洒，把颓废当自由，把逃避责任当做追求自我价值。不过是懒，怕吃苦，哪来那么多好听的理由。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (854, 0, '生活经验告诉我，吃不到鸡肉的人才只能喝汤。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (855, 0, '你把性格交给星座，把努力交给鸡汤，然后对自己说：“听过许多道理，但依然过不好这一生”。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (856, 0, '若你的朋友每天生活都这么幸福，也就不会拍成照片发到朋友圈了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (857, 0, '骑白马的不一定是王子，也可能会是是唐僧！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (858, 0, '这个世界没有错，谁让你长得不好看又没钱。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (859, 0, '早起的鸟儿有虫吃，可惜你是那条虫。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (860, 0, '上帝在给你关上一扇门的同时，还会用门夹你的脑子。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (861, 0, '万事开头难，然后中间难，最后结尾难。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (862, 0, '生活为你关上一道门的同时还会告诉你，这么丑就躲在家里吧。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (863, 0, '岁月让我知道，除了快递我谁都不必等。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (864, 0, '在我们这个年纪，金钱和长相决定了太多东西。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (865, 0, '有些事情做不完，就明天再做吧，万一运气好明天就死了呢是不。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (866, 0, '每天对着镜子说你真的很棒，那这块镜子应该是真的很棒。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (867, 0, '天空没有翅膀的痕迹，除非你飞的时候会掉毛。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (868, 0, '年轻人不要老想着走捷径，父母强才是硬道理。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (869, 0, '不是吃燕窝的人皮肤好，是吃得起燕窝的人皮肤好。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (870, 0, '你以为有了钱就会像你想象中那样快乐吗？不，你错了。有钱人的快乐，你根本想象不到。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (871, 0, '长得好看的才叫吃货，长得不好看的那叫饭桶！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (872, 0, '回首往事，我发现自己失去了很多宝贵的东西。但我并不难过，因为我知道，以后会失去的更多。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (873, 0, '女人假装高潮来维持恋爱，而男人假装恋爱以获得高潮。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (874, 0, '别人一问起你，你就和盘托出，你以为这是健谈和热情，其实，这是孤独。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (875, 0, '不要看别人表面上一帆风顺，实际上，他们背地里，也是一帆风顺。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (876, 0, '不逼自己一把怎么知道拼了也没用呢?', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (877, 0, '你连世界都没观过，哪来的世界观？', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (878, 0, '一路上有你，苦一点也愿意，苦很多就算了吧。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (879, 0, '一些兴趣和特长，拿来做业余还挺NB的，但一旦变成职业，就弱得不行了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (880, 0, '暑假定了一个PLAN，但我因为LAN，一个P都没完成。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (881, 0, '只有多替领导背锅，领导才会把你，当成傻子啊。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (882, 0, '我的意中人是盖世英雄，有一天他会踩着七色彩云娶别人。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (883, 0, '大家能别骗自己么，努力得来的东西毫无价值，不劳而获才万分喜悦。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (884, 0, '日落西山你不陪，东山再起你是谁？同甘共苦你不在，荣华富贵你不配！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (885, 0, '啃老啃的理所当然。家里有钱你的羡慕啊，你不啃首付款，不是因为啃不到么？能啃不啃我还没见过！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (886, 0, '思想给了我们太多的自由，而我们拖累了思想！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (887, 0, '“就算全世界反对，我也要坚持自己的梦想。”你谁啊，能轮到全世界反对？', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (888, 0, '放心吧 有钱人运气都不会太差的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (889, 0, '多少做手机贴膜的人，经过不懈的努力，贴了更多的膜。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (890, 0, '感谢前行路上击倒我的人，因为，躺着真的好舒服。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (891, 0, '长得好看不能当饭吃，但是长得不好看真的会让人吃不下饭。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (892, 0, '你并不是一无所有，你还有病啊！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (893, 0, '注重细节，从小事做起，因为你也做不了大事。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (894, 0, '如果你很忙，除了你这真的很重要之外，更可能的原因是：你很弱。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (895, 0, '每当我找到成功的钥匙，就发现有人把锁给换了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (896, 0, '塞牙是牙缝大于脑洞者的宿命。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (897, 0, '绝望不在某时某刻，而在每时每刻。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (898, 0, '等我变得更好再去喜欢你吧，后来想想算了，变得那么好干嘛还去喜欢你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (899, 0, '喜欢的人一定要去告白啊，不被拒绝一下你还真当自己是仙女了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (900, 0, '因为要占9.9的优惠，特地点了个49.9的不爱吃的菜，就像很多人的人生。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (901, 0, '回首过去，我居然没有，走过一次直路。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (902, 0, '又一天过去了，今天过的怎么样啊？梦想是不是更远了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (903, 0, '只有能力强会被当成纯技术人员;而光会社交拍马又会被认为没有真才实学;所以，要想在单位中脱颖而出，最重要的是有关系。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (904, 0, '有人说你傻，不是觉得你可爱，是真的觉得你傻。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (905, 0, '本以为牵了小姐姐的手，可以得到她，没想到小姐姐是千手观音。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (906, 0, '你总想等你优秀了再去向她表白，后来才发现人家只是单纯的不喜欢你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (907, 0, '一个胖的人是不可能有气质的，这条真理的客观程度等同于“人总有死的那天”。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (908, 0, '没钱没事业的人，才有时间去提高自己的人生境界。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (909, 0, '你多努力一点，获得的打击就多一点。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (910, 0, '哪有什么选择恐惧症，还不是因为穷。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (911, 0, '天道好轮回，苍天饶过谁。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (912, 0, '你所有的忧伤，都来自于你的余额。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (913, 0, '不要担心，一切都是最烂的安排。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (914, 0, '存款是负的房子是租的，有辆自行车，还是共享的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (915, 0, '要是有个地方能出卖自己的灵魂换取物质享受就好了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (916, 0, '谢谢那些曾经击倒我的人，躺着真他妈舒服。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (917, 0, '白天嘈杂得不愿意醒，夜晚安静得舍不得睡。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (918, 0, '挣钱是一种能力，花钱是一种技术，我能力有限，技术却很高。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (919, 0, '如果你觉得自己，整天累得跟狗一样。 你真是误会大了，狗都没有你这么累。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (920, 0, '我养你啊，这是句动听的话。可惜多半是假的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (921, 0, '我要是有钱或者长得好看就好了。那样，即使我性格有点儿怪，也会有人愿意倾听我的想法和感受，跟我做朋友。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (922, 0, '现实就是，你这个前浪还没开始浪，就已经被拍死在沙滩上了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (923, 0, '无论遇到任何事情，在哪里跌倒，就在那多躺一会吧。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (924, 0, '都说姐漂亮，其实都是妆出来的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (925, 0, '江湖水深，不浪怎知？', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (926, 0, '每次看到穷游日志的感受都是：那么穷就别TM出去浪了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (927, 0, '你只看到别人化了妆这么好看，却不知道，她们卸了妆一样美丽。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (928, 0, '学会对自己宽容，饿了就吃，困了就睡，不要表现得只要你不吃不喝不睡就一定能成功一样。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (929, 0, '朋友买了块户外手表，质量很赞。从悬崖落下去都没坏，就是人死了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (930, 0, '“老师您好，请问像我这样的，没有背景的北大毕业生应该如何定位自己?” “社会底层群众中受教育程度最高的一批人。”', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (931, 0, '万事开头难，中间难，最后更难。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (932, 0, '在你最需要帮助的时候，只有鬼才来帮你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (933, 0, '如果你是长得好看的话，在公车地铁上睡着了，头靠在旁边人的肩上，旁边的人会一直陪着你直到醒来。你要是长的丑的话，头一旦靠在旁边的人肩上，他会立即拍醒你，并温馨提醒你保管好财物。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (934, 0, '别人下班泡妞，你下班泡面。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (935, 0, '没有梦想，至少还可以做梦啊。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (936, 0, '小明吃了麻婆豆腐，于是他被麻婆告非礼。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (937, 0, '灰姑娘的鞋若是合脚当初就不会掉，王子若是真的爱灰姑娘就不会连和自己跳了一晚上的舞的女孩都不认识。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (938, 0, '岁月是把杀猪刀，可是他拿丑的人，一点办法都没有。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (939, 0, '你那么胖，一定很善良。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (940, 0, '对今天解决不了的事情，也不要着急。因为明天也可能还是解决不了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (941, 0, '一鼓作气，再而卒。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (942, 0, '当别人和你说忙，是他/她要留时间给更重要的人。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (943, 0, '钱买不来快乐，那一定是，你的钱太少了！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (944, 0, '你说自己很丑，我觉得你不仅丑，还净说实话。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (945, 0, '就算睡得晚，不会找你的人还是不会找你！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (946, 0, '现在的生活或许不是你想要的，但绝对是你自找的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (947, 0, '爱情是把双刃剑，一边把你割得很疼，另一边也把你割得很疼。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (948, 0, '每次花钱都说钱包在滴血，可殊不知你的钱包，已经失血过多而死了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (949, 0, '暴风雨之后，不仅没看到彩虹，还感冒了！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (950, 0, '只要功夫深铁杵磨成针，但真把铁杵磨成针的，绝对是大傻瓜。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (951, 0, '你虽然长得丑，但你还矮呀。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (952, 0, '每一个想等事业起步之后在结婚的男人，最后大多数都成了单身。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (953, 0, '年轻的男孩只希望自己的女朋友是美丽的。而随着他不断长大，阅历的不断积累，他终归会认识到：美丽并不是选择伴侣的全部，性感也很重要。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (954, 0, '上帝给了你丑的外表跟低的智商，就是怕你不协调。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (955, 0, '多年过去，再回忆高考，其实本质上没有考到好与坏的说法，重要的是年轻人在一起，做份试题，然后决定去哪座城市做代购。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (956, 0, '给你的梦想插上翅膀，虽然不一定飞得很远，但肯定摔的很重。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (957, 0, '曾经才华横溢的你，现在只会说666。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (958, 0, '除了有钱人，世上还有两种人：其一是省吃俭用买奢侈品装逼的，其二是省吃俭用也买不起奢侈品的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (959, 0, '我没见过一个煤矿工人靠挖煤又快又多当上了煤老板。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (960, 0, '咸鱼翻身还是咸鱼。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (961, 0, '选择比努力更重要，所以我选择不努力。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (962, 0, '遇到喜欢的女生要勇敢表白，只有你主动了，才知道她名花有主。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (963, 0, '常听到别人说：我希望他/她有什么话当面说，不要在别后中伤人。一些人信以为真，而实际上，我的实践证明，当面说别人坏话，别人会非常愤怒，难堪。所以中伤别人一定要在背后。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (964, 0, '我烂泥好好的摊在地上 不要你们扶。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (965, 0, '大作不死，必有下回。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (966, 0, '失恋的时候，许多年轻人以为整个世界都抛弃了自己，别傻了，世界根本就没需要过你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (967, 0, '余生不想请你指教了，领教够了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (968, 0, '我不找你，是我有骨气。你不找我，你就是死了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (969, 0, '很久不开QQ，登录后才发现，原来只有腾讯新闻在乎你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (970, 0, '喜欢一个人就去表白，万一成备胎了呢。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (971, 0, '除了有钱人，世上还有两种人：其一是省吃俭用买奢侈品装逼，其二是省吃俭用也买不起奢侈品的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (972, 0, '如果你的男朋友对你百依百顺，从不拈花惹草。可能是因为他钱不够。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (973, 0, '一见钟情就是好看，深思熟虑就是没钱。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (974, 0, '钱是万恶之源，但如果你没钱，整个社会都会鄙视你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (975, 0, '就算是咸鱼，你也不是最咸的那条。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (976, 0, '盖茨休学创业成了世界富翁，但人家休的是哈佛大学。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (977, 0, '定期去检查身体吧，别等最后别人送你去。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (978, 0, '其实你也不是一无是处，至少在夏天，你还能喂蚊子。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (979, 0, '我追逐自己的梦想，别人说我幼稚可笑，但我坚持了下来。最后发现，原来还真是我以前幼稚可笑。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (980, 0, '不知不觉潮流变成了怀旧。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (981, 0, '为什么要努力？为了在你夹菜的时候别人不敢转桌子。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (982, 0, '不是大家拿你开玩笑，而是，你就是玩笑本身！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (983, 0, '当你能够飞翔的时候，就一定要上天台。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (984, 0, '穷不要紧，抬头挺胸，让大家看看，你不仅穷而且还丑。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (985, 0, '男女之间一定有纯友谊，每一个我认识的女生，都说最多只能跟我当朋友。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (986, 0, '平时看书是因为求知欲，考前看书是因为求生欲。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (987, 0, '上了大学你们就解放了，紧跟着就是抗美援朝，三年饥荒。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (988, 0, '如果有一天我消失了，即使我的朋友恋人不会找我，银行也会疯狂找我。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (989, 0, '电视剧里被霸道总裁看上的善良傻白甜没有一个长得丑的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (990, 0, '这一秒不放弃，下一秒，就更绝望了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (991, 0, '我这么拼命的努力只是为了向那些曾经看不起我的人证明他们是对的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (992, 0, '世界上最好的词就是虚惊一场。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (993, 0, '做事三思而后行，1、能不能不做，2、能不能明天做，3、能不能交给别人做。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (994, 0, '岁月是把杀猪刀,可他拿丑的人一点办法都没有', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (995, 0, '如果有天发现你一夜暴富了，给自己一巴掌，快醒来别上班迟到了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (996, 0, '我已经不是那个花五十块钱也要考虑很久的小女孩了，现在五块钱都要深思熟虑。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (997, 0, '我每天都觉得自己能创造奇迹，对，我就是那么傻的可以。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (998, 0, '垃圾还有大爷大妈捡走，你呢？', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (999, 0, '这时代做什么事，门槛都变得好高。 想说当个宅男，还要先买得起房子。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1000, 0, '很多次我都觉得坚持不住了，然后我就放弃了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1001, 0, '希望无时无刻不在，而你，每时每刻都错过。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1002, 0, '你走了真好，不然总担心你要留下来吃饭。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1003, 0, '有些人出现在你的生命里，是为了告诉你，你真好骗！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1004, 0, '世界上如果有钱办不到的事情，加钱一定可以办到。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1005, 0, '别动不动就把问题交给时间来证明，时间懒得理你这个烂摊子。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1006, 0, '你要是和自拍长得一样，怎么会没有男朋友。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1007, 0, '那些学历比你高，家室比你好，长得还比你好看的都这么努力，你努力还有什么用啊？', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1008, 0, '知道为什么自古红颜多薄命吗？因为没有人在意丑的人活多久。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1009, 0, '事业缺火，命里缺金。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1010, 0, '世界感受不到你的恶意，世界知道你是个傻逼。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1011, 0, '去年给自己定了个小目标存款三万，今年打开支付宝发现还差五万就是实现了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1012, 0, '机会，永远留给，有胸有颜的人。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1013, 0, '不是别人瞧不起你，只是别人瞧不见你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1014, 0, '穷真的不可怕，可怕的是你的亲戚朋友都觉得你很有钱。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1015, 0, '岁月是把杀猪刀，是针对那些好看的人，它对长得丑的人一点办法都没有。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1016, 0, '假期定了个Plan，半个暑假结束了只完成了P，因为lan。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1017, 0, '人人都想拯救世界，却没人帮妈妈洗碗。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1018, 0, '好看的皮囊与你无关，有趣的灵魂你又没有。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1019, 0, '这世界99%的事都可以用钱来解决，唯一不能解决的那1%就是钱不够。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1020, 0, '你死不放手的样子特别丑。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1021, 0, '很多人不断地规划自己的人生，每天压力很大。其实不管你怎么过。都会后悔的。想想你这前几十年就明白了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1022, 0, '蠢也没那么可怕，毕竟水母没有脑子，也活了6亿年。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1023, 0, '你的美别人看不到，你的丑一目了然。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1024, 0, '长相不行的人，为人也未必好。只不过由于长久寂寞的折磨，有时会发疯似地对人好。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1025, 0, '倾尽全力最后无能为力。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1026, 0, '出卖自己的灵魂和原则并不丢人，丢人的是没能卖一个好价钱。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1027, 0, '“为什么我总是碰不上好运气?””因为好运气可没那么倒霉啊。“', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1028, 0, '反正都要失败不如放手去做，失败之后跑路就好了。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1029, 0, '有些事不是努力就可以改变的，五十块的人民币设计的再好看，也没有一百块的招人喜欢。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1030, 0, '送给喜欢的女生一支口红吧，这样她亲别人的时候，你还有点参与感。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1031, 0, '当你变得足够优秀的时候，你才发现原来她只是，单纯的不喜欢你。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1032, 0, '如果我的人生是一部电影，那你就是一个弹出来的广告。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1033, 0, '打趴下就不要爬起来了，反正还是会被打到趴下。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1034, 0, '滴水穿石，厚积薄发，年轻人要学会沉淀自己，要知道压力过大易导致内分泌失调，只会让你越来越沉，沉。。。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1035, 0, '高考在昨天，考研在明天，今天没有什么事儿。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1036, 0, '吃土的时候，觉得乞丐都比我幸福。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1037, 0, '你感冒了，身边的人嘱咐你好好吃药。你以为是关心你，其实他只是怕你传染他而已。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1038, 0, '只有讨厌人的时候才需要理由吧！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1039, 0, '胸怀鸿鹄之志，手无缚鸡之力。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1040, 0, '生活会让你苦上一阵子，等你适应之后，再让你苦上一辈子。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1041, 0, '丑小鸭小时候很丑，但是长大了以后还是挺好吃的。', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
INSERT INTO `chicken_soup` VALUES (1042, 0, '长的美与不美不重要，想的美才是真的美！', '2019-04-13 17:40:28', '1000-01-01 00:00:00', '', '');
